                                 data-noSvg="img/png-icon/design.png"
                                 src="data:image/svg+xml;base64,">
                            <h2>Design</h2>
                        </div>
                        <p>I have a passion for design and the role it plays in intuitive yet compelling UI and UX systems. Building an effective answer to a brief is an exciting part of being a web designer. The ability to convert a visual concept into code is a fundamental strength I utilise when fleshing out an aesthetic. This allows me to drive successful projects from initial conception to live execution.</p>
                    </li>
                    <li class="intro development right">
                        <div class="title">
                            <img class="svgIcon"
                                 data-noSvg="img/png-icon/development.png"
                                 src="data:image/svg+xml;base64,">
                            <h2>Development</h2>
                        </div>
                        <p>Bringing a client’s concept to life using a wide variety of innovative solutions is an area that I thrive in as a web developer. Developing rich HTML5 applications with a high level of polish using responsive design, slick animation, unique interactivity and server side technologies is something that I take pride in.</p>
                    </li>
                    <div class="seperator"></div>
                    <li class="intro experience left">
                        <div class="title">
                        <img class="svgIcon"
                             data-noSvg="img/png-icon/experience.png"
                             src="data:image/svg+xml;base64,">
                            <h2>Experience</h2>
                        </div>
                        <p>I have a BMA majoring in digital design in addition to over six year of real world creative experience. I have developed executions for many of the countries biggest brands working under tight deadlines in both individual and collaborative based environments.</p>
                    </li>
                    <li class="intro employment right">
                        <div class="title">
                            <img class="svgIcon"
                                 data-noSvg="img/png-icon/employment.png"
                                 src="data:image/svg+xml;base64,">
                            <h2>Current Employment</h2>
                        </div>
                        <p>I currently work for Fairfax Media as the Digital Specialist for the Product Development team. I direct my team to drive innovative rich media solutions that reside on stuff.co.nz and support projects with my digital expertise.</p>
                    </li>
                </ul> <!-- end of center -->

